/* Filter element of access list */
struct filter
{
    /* For doubly linked list. */
    struct filter *next;
    struct filter *prev;

    /* Filter type information. */
    enum filter_type type;

    /* Cisco access-list */
    int cisco;

    /*Filter Location */
    unsigned long num;

    union
    {
        struct filter_cisco cfilter;
        struct filter_zebra zfilter;
    } u;
};

