/* Return string of filter_type. */
static const char *
filter_type_str (struct filter *filter)
{
    switch (filter->type)
    {
    case FILTER_PERMIT:
        return "permit";
        break;
    case FILTER_DENY:
        return "deny";
        break;
    case FILTER_DYNAMIC:
        return "dynamic";
        break;
    default:
        return "";
        break;
    }
}

long char_to_int(char *name)
{
    long number;

    unsigned int i;

    for (number = 0, i = 0; i < strlen(name); i++)
    {
        if (isdigit((int)name[i]))
            number = (number * 10) + (name[i] - '0');
        else
            break;
    }
    return number;
}

unsigned int mask_bit_cnt(unsigned u)
{
    unsigned ret = 0;

    while (u)
    {
        u = (u & (u - 1));          // ? u ???? 1 ??
        ret++;
    }
    return ret;
}
/* If filter match to the prefix then return 1. */
static int
filter_match_cisco (struct filter *mfilter, struct prefix *p)
{
    struct filter_cisco *filter;
    struct in_addr mask;
    u_int32_t check_addr;
    u_int32_t check_mask;

    filter = &mfilter->u.cfilter;
    check_addr = p->u.prefix4.s_addr & ~filter->addr_mask.s_addr;

    if (filter->extended)
    {
        masklen2ip (p->prefixlen, &mask);
        check_mask = mask.s_addr & ~filter->mask_mask.s_addr;

        if (memcmp (&check_addr, &filter->addr.s_addr, 4) == 0
                && memcmp (&check_mask, &filter->mask.s_addr, 4) == 0)
            return 1;
    }
    else if (memcmp (&check_addr, &filter->addr.s_addr, 4) == 0)
        return 1;

    return 0;
}

/* If filter match to the prefix then return 1. */
static int
filter_match_zebra (struct filter *mfilter, struct prefix *p)
{
    struct filter_zebra *filter;

    filter = &mfilter->u.zfilter;

    if (filter->src_prefix.family == p->family)
    {
        if (filter->exact)
        {
            if (filter->src_prefix.prefixlen == p->prefixlen)
                return prefix_match(&filter->src_prefix, p);
            else
                return 0;
        }
        else
            return prefix_match(&filter->src_prefix, p);
    }
    else
        return 0;
}

