/*
*sangmeng add for delete rule form interface
*eg: iptables -D INPUT -i eth0 -s 10.0.0.0/24 -j REJECT
*iptables_rule :INPUT/OUTPUT(FORWARD)
*ifp_name : interface name
*addr_str : source addr
*addr_mask : mask bits
*addr_mask_str : mask addr
*mask_mask : mask mask bits
*protocol_type: IP/TCP/ICMP
*iptables_type :ACCEPT/REJECT
*flag : 0 delete rule  1 add rule
*/
static int ip_filter(const char *rule,
                     char *ifp_name,
                     char *addr_str,
                     unsigned int addr_mask,
                     char *addr_mask_str,
                     unsigned int mask_mask,
                     char *protocol_type, char *iptables_type, int flag)
{
    char *iptables_cmd;

    char *cmd_buf;

    iptables_cmd = (char *)calloc(1, 1024);
    cmd_buf = (char *)calloc(1, 1024);
    if (flag == 0)
    {
        if (strcmp(rule, "in") == 0)
        {
            sprintf(iptables_cmd,
                    "iptables -D INPUT -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
            sprintf(cmd_buf,
                    "iptables -D FORWARD -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
        }
        else
            sprintf(iptables_cmd,
                    "iptables -D FORWARD -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
    }
    if (flag == 1)
    {
        if (strcmp(rule, "in") == 0)
        {
            sprintf(iptables_cmd,
                    "iptables -A INPUT -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
            sprintf(cmd_buf,
                    "iptables -A FORWARD -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
        }
        else
            sprintf(iptables_cmd,
                    "iptables -A FORWARD -p %s -i %s -s %s/%d -d %s/%d -j %s",
                    protocol_type, ifp_name, addr_str, addr_mask,
                    addr_mask_str, mask_mask, iptables_type);
    }
    system(iptables_cmd);
    system(cmd_buf);

    if (iptables_cmd)
    {
        free(iptables_cmd);
        iptables_cmd = NULL;
    }
    if (cmd_buf)
    {
        free(cmd_buf);
        cmd_buf = NULL;
    }
    return CMD_SUCCESS;
}

