/* Get access list from list of access_list.  If there isn't matched
   access_list create new one and return it. */
struct access_list *access_list_get(struct vty *vty, afi_t afi,
                                    const char *name)
{
    struct access_list *access;

    access = access_list_lookup (afi, name);
    if (access == NULL)
    {
        if (afi == AFI_IP)
        {
            ipv4_count++;
            if (ipv4_count > 10)
            {
                vty_out(vty, "%% IPV4 rule number should less than 10%s",
                        VTY_NEWLINE);
                ipv4_count = 10;
                //vty_out(vty, " now ipv4 count %d%s", ipv4_count, VTY_NEWLINE);
                return NULL;
            }
        }
        else if (afi == AFI_IP6)
        {
            ipv6_count++;
            if (ipv6_count > 10)
            {
                vty_out(vty, "%% IPV6 rule number should less than 10%s",
                        VTY_NEWLINE);
                ipv6_count = 10;
                //vty_out(vty, " now ipv4 count %d%s", ipv4_count, VTY_NEWLINE);
                return NULL;
            }
        }
        access = access_list_insert(afi, name);
    }
    return access;
}

/* Apply access list to object (which should be struct prefix *). */
enum filter_type
access_list_apply (struct access_list *access, void *object)
{
    struct filter *filter;
    struct prefix *p;

    p = (struct prefix *) object;

    if (access == NULL)
        return FILTER_DENY;

    for (filter = access->head; filter; filter = filter->next)
    {
        if (filter->cisco)
        {
            if (filter_match_cisco (filter, p))
                return filter->type;
        }
        else
        {
            if (filter_match_zebra (filter, p))
                return filter->type;
        }
    }

    return FILTER_DENY;
}

