/*sangmeng add for insert filter by sequence*/
static void
filter_list_insert_by_sequence(struct access_list *access,
                               struct filter *filter, unsigned long num)
{
    struct filter *node;

    filter->num = num;
    for (node = access->head; node; node = node->next)
        if (node->num > num)
            break;
    /* In case of this is the first element of access. */
    if (access->head == NULL)
    {
        access->head = access->tail = filter;
        return;
    }
    /* In case of insertion is made at the tail of filter_list. */
    if (node == NULL)
    {
        filter->prev = access->tail;
        access->tail->next = filter;
        access->tail = filter;
        return;
    }
    /* In case of insertion is made at the head of filter_list. */
    if (node == access->head)
    {
        filter->next = access->head;
        access->head->prev = filter;
        access->head = filter;
        return;
    }

    /* Insertion is made at middle of the filter_list. */
    filter->next = node;
    filter->prev = node->prev;

    if (node->prev)
        node->prev->next = filter;
    node->prev = filter;

    return;
}

static int filter_list_delete_same_sequence(struct access_list *access,
        unsigned long num)
{
    struct filter *node;

    for (node = access->head; node; node = node->next)
        if (node->num == num)
        {
            if (node->next)
                node->next->prev = node->prev;
            else
                access->tail = node->prev;

            if (node->prev)
                node->prev->next = node->next;
            else
                access->head = node->next;

            filter_free(node);
            return 1;
        }

    return 0;
}

static void filter_list_get(struct vty *vty, struct access_list *access,
                            struct filter *filter, unsigned long num,
                            afi_t afi)
{
    int ret;

    ret = filter_list_delete_same_sequence(access, num);
    if (ret == 0)
    {
        if (afi == AFI_IP)
        {
            access->ipv4_filter_count++;
            if (access->ipv4_filter_count > 2000)
            {
                vty_out(vty, "%% IPV4 filter should up to 2000%s", VTY_NEWLINE);
                access->ipv4_filter_count = 2000;
                return;
            }
        }
        else if (afi == AFI_IP6)
        {
            access->ipv6_filter_count++;
            if (access->ipv6_filter_count > 2000)
            {
                vty_out(vty, "%% IPV6 filter should up to 2000%s", VTY_NEWLINE);
                access->ipv6_filter_count = 2000;
                return;
            }
        }
    }

    filter_list_insert_by_sequence(access, filter, num);
}

/* Add new filter to the end of specified access_list. */
static void
access_list_filter_add(struct vty *vty, struct access_list *access,
                       struct filter *filter, const char *num_str,
                       afi_t afi)
{
    unsigned long num;

    if (num_str == NULL)
    {
        if (afi == AFI_IP)
        {
            access->ipv4_filter_count++;
            if (access->ipv4_filter_count > 2000)
            {
                vty_out(vty, "%% IPV4 filter should up to 2000%s", VTY_NEWLINE);
                access->ipv4_filter_count = 2000;
                return;
            }
        }
        else if (afi == AFI_IP6)
        {
            access->ipv6_filter_count++;
            if (access->ipv6_filter_count > 2000)
            {
                vty_out(vty, "%% IPV6 filter should up to 2000%s", VTY_NEWLINE);
                access->ipv6_filter_count = 2000;
                return;
            }
        }
        filter->next = NULL;
        filter->prev = access->tail;

        if (access->tail)
        {
            access->tail->next = filter;
            filter->num = (access->tail->num) + 10;
        }
        else
        {
            access->head = filter;
            filter->num = 10;
        }
        access->tail = filter;

    }
    else
    {
        num = atol(num_str);
        filter_list_get(vty, access, filter, num, afi);
    }

#if 0
    /* Run hook function. */
    if (access->master->add_hook)
        (*access->master->add_hook) (access);
#endif
}

/* If access_list has no filter then return 1. */
static int
access_list_empty (struct access_list *access)
{
    if (access->head == NULL && access->tail == NULL)
        return 1;
    else
        return 0;
}

/* Delete filter from specified access_list.  If there is hook
   function execute it. */
static void
access_list_filter_delete (struct access_list *access, struct filter *filter)
{
    struct access_master *master;

    master = access->master;

    if (filter->next)
        filter->next->prev = filter->prev;
    else
        access->tail = filter->prev;

    if (filter->prev)
        filter->prev->next = filter->next;
    else
        access->head = filter->next;

    filter_free (filter);
#if 0
    /* If access_list becomes empty delete it from access_master. */
    if (access_list_empty (access))
        access_list_delete (access);
#endif
    /* Run hook function. */
    if (master->delete_hook)
        (*master->delete_hook) (access);
}

