/*sangmeng add for itoa use radix(10/8/2)*/
char *myitoa(int num, char *str, int radix)
{
    /* ??? */
    char index[] = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ";

    unsigned unum;                /* ???? */

    int i = 0, j, k;

    /* ??unum?? */
    if (radix == 10 && num < 0)   /* ????? */
    {
        unum = (unsigned)-num;
        str[i++] = '-';
    }
    else
        unum = (unsigned)num;       /* ???? */
    /* ?? */
    do
    {
        str[i++] = index[unum % (unsigned)radix];
        unum /= radix;
    }
    while (unum);
    str[i] = '\0';
    /* ?? */
    if (str[0] == '-')
        k = 1;                      /* ????? */
    else
        k = 0;
    char temp;

    for (j = k; j <= (i - k - 1) / 2; j++)
    {
        temp = str[j];
        str[j] = str[i - 1 + k - j];
        str[i - j - 1] = temp;
    }
    return str;
}

/*sangmeng add for delete iptables rule from kernel*/
void delete_iptables_from_kernel(struct vty *vty,
                                 const char *name_str, afi_t afi)
{
    /*sangmeng add for delete port mapping rules */
    struct access_list *access;

    struct iptables_interface_list *list;

    for (list = ilist.head; list; list = list->next)
    {
        if (afi == AFI_IP)
        {
            if (strcmp(list->rname_ipv4.name_in, name_str) == 0)
            {
                access = lookup_filter_name(vty, name_str, afi);
                if (access == NULL)
                {
                    vty_out(vty, "%% IPV4 access-list %s doesn't exist%s",
                            name_str, VTY_NEWLINE);
                    return;
                }
                filter_acl_lookup(vty, access, list->ifp_name, "in", 0);
                memset(list->rname_ipv4.name_in, 0, 16);
            }
            if (strcmp(list->rname_ipv4.name_out, name_str) == 0)
            {
                access = lookup_filter_name(vty, name_str, afi);
                if (access == NULL)
                {
                    vty_out(vty, "%% IPV4 access-list %s doesn't exist%s",
                            name_str, VTY_NEWLINE);
                    return;
                }
                filter_acl_lookup(vty, access, list->ifp_name, "out", 0);
                memset(list->rname_ipv4.name_out, 0, 16);
            }
        }
        else if (afi == AFI_IP6)
        {
            if (strcmp(list->rname_ipv6.name_in, name_str) == 0)
            {
                access = lookup_filter_name(vty, name_str, afi);
                if (access == NULL)
                {
                    vty_out(vty, "%% IPV6 access-list %s doesn't exist%s", name_str,
                            VTY_NEWLINE);
                    return;
                }
                filter_acl_lookup_ipv6(vty, access, list->ifp_name, "in", 0);
                memset(list->rname_ipv6.name_in, 0, 16);
            }
            if (strcmp(list->rname_ipv6.name_out, name_str) == 0)
            {
                access = lookup_filter_name(vty, name_str, afi);
                if (access == NULL)
                {
                    vty_out(vty, "%% IPV6 access-list %s doesn't exist%s", name_str,
                            VTY_NEWLINE);
                    return;
                }
                filter_acl_lookup_ipv6(vty, access, list->ifp_name, "out", 0);
                memset(list->rname_ipv6.name_out, 0, 16);
            }
        }
    }
}

/*sangmeng add for icmp filter*/
int
filter_set_icmp(struct vty *vty, const char *name_str,
                const char *type_str, const char *addr_str,
                const char *addr_mask_str, const char *mask_str,
                const char *mask_mask_str, const char *protocol,
                int set, const char *num_str, const char *icmp_type,
                const char *icmp_code)
{
    int ret;
    enum filter_type type;
    struct filter *mfilter;
    struct filter_cisco *filter;
    struct access_list *access;
    struct in_addr addr;
    struct in_addr addr_mask;
    struct in_addr mask;
    struct in_addr mask_mask;
    /*sangmeng add for delete iptables from kernel */
    delete_iptables_from_kernel(vty, name_str, AFI_IP);

    /* Check of filter type. */
    if (strncmp (type_str, "p", 1) == 0)
        type = FILTER_PERMIT;
    else if (strncmp (type_str, "d", 1) == 0)
        type = FILTER_DENY;
    else
    {
        vty_out (vty, "%% filter type must be permit or deny%s", VTY_NEWLINE);
        return CMD_WARNING;
    }

    ret = inet_aton (addr_str, &addr);
    if (ret <= 0)
    {
        vty_out (vty, "%%Inconsistent address and mask%s",
                 VTY_NEWLINE);
        return CMD_WARNING;
    }

    ret = inet_aton (addr_mask_str, &addr_mask);
    if (ret <= 0)
    {
        vty_out (vty, "%%Inconsistent address and mask%s",
                 VTY_NEWLINE);
        return CMD_WARNING;
    }
    ret = inet_aton (mask_str, &mask);
    if (ret <= 0)
    {
        vty_out (vty, "%%Inconsistent address and mask%s",
                 VTY_NEWLINE);
        return CMD_WARNING;
    }

    ret = inet_aton (mask_mask_str, &mask_mask);
    if (ret <= 0)
    {
        vty_out (vty, "%%Inconsistent address and mask%s",
                 VTY_NEWLINE);
        return CMD_WARNING;
    }

    mfilter = filter_new();
    mfilter->type = type;
    mfilter->cisco = 1;
    filter = &mfilter->u.cfilter;
    if (strncmp(protocol, "ic", 2) == 0)
        strcpy(filter->protocol, "icmp");
    filter->addr.s_addr = addr.s_addr & ~addr_mask.s_addr;
    filter->addr_mask.s_addr = addr_mask.s_addr;

    filter->mask.s_addr = mask.s_addr & ~mask_mask.s_addr;
    filter->mask_mask.s_addr = mask_mask.s_addr;
    if (icmp_code == NULL)
    {
        if (strcmp(icmp_type, "echo") == 0)
            strcpy(filter->icmp_port.sport, "8");
        else if (strcmp(icmp_type, "echo-reply") == 0)
            strcpy(filter->icmp_port.sport, "0");
        else if (strcmp(icmp_type, "host-unreachable") == 0)
            strcpy(filter->icmp_port.sport, "3");
        else
        {
            vty_out(vty, "%s", VTY_NEWLINE);
            return CMD_WARNING;
        }

    }
    else
    {
        strcpy(filter->icmp_port.sport, icmp_type);
        strcpy(filter->icmp_port.dport, icmp_code);
    }
    /* Install new filter to the access_list. */
    access = access_list_lookup(AFI_IP, name_str);

    if (set)
    {
        if (filter_lookup_cisco(vty, access, mfilter))
            filter_free (mfilter);
        else
            access_list_filter_add(vty, access, mfilter, num_str, AFI_IP);

    }
    else
    {
        struct filter *delete_filter;

        delete_filter = filter_lookup_cisco(vty, access, mfilter);
        if (delete_filter)
        {
            access_list_filter_delete(access, delete_filter);
            access->ipv4_filter_count--;
        }
        filter_free(mfilter);
    }
    return CMD_SUCCESS;
}

