/* show access-list command. */

/*notice here s*/
static int filter_show(struct vty *vty, const char *name, afi_t afi)
{
    struct access_list *access;

    struct access_master *master;

    struct filter *mfilter;

    struct filter_cisco *filter;

    int write = 0;

    //vty_out(vty, "afi %hu %s", afi, VTY_NEWLINE);
    master = access_master_get(afi);
    if (master == NULL)
        return 0;

    /* Print the name of the protocol */
#if 0                           //sangmeng add
    if (zlog_default)
        vty_out(vty, "%s:%s",
                zlog_proto_names[zlog_default->protocol], VTY_NEWLINE);
#endif
    for (access = master->num.head; access; access = access->next)
    {
        if (name && strcmp(access->name, name) != 0)
            continue;

        vty_out(vty, "%s IP%s access list %s%s",
                "Extended",
                afi == AFI_IP6 ? "v6" : "", access->name, VTY_NEWLINE);

        for (mfilter = access->head; mfilter; mfilter = mfilter->next)
        {
            filter = &mfilter->u.cfilter;

            vty_out(vty, "    %lu", mfilter->num);
            vty_out(vty, " %s%s", filter_type_str(mfilter),
                    mfilter->type == FILTER_DENY ? "  " : "");

            if (!mfilter->cisco)
                config_write_access_zebra(vty, mfilter);
            else
                config_write_access_cisco(vty, mfilter);

        }
    }

    for (access = master->str.head; access; access = access->next)
    {
        if (name && strcmp(access->name, name) != 0)
            continue;

        vty_out(vty, "%s IP%s access list %s%s",
                "Extended",
                afi == AFI_IP6 ? "v6" : "", access->name, VTY_NEWLINE);

        for (mfilter = access->head; mfilter; mfilter = mfilter->next)
        {
            filter = &mfilter->u.cfilter;

            vty_out(vty, "    %lu", mfilter->num);
            vty_out(vty, " %s%s", filter_type_str(mfilter),
                    mfilter->type == FILTER_DENY ? "  " : "");

            if (!mfilter->cisco)
                config_write_access_zebra(vty, mfilter);
            else
                config_write_access_cisco(vty, mfilter);

        }
    }
    return CMD_SUCCESS;
}

/*add by s for access applied interface*/
int
filter_add_to_interface(struct vty *vty, struct interface *ifp,
                        const char *name, const char *rule, afi_t afi)
{
    int ret;

    char *ifp_name;

    ifp_name = (char *)calloc(1, 64);
    if (ifp_name == NULL)
    {
        vty_out(vty, "ifp_name calloc error%s", VTY_NEWLINE);
        return CMD_WARNING;
    }
    strcpy(ifp_name, ifp->name);

    ret = add_name_interface(vty, name, ifp_name, rule, afi);
    if (ret == 1)
    {
        vty_out(vty, "add name to interface error%s", VTY_NEWLINE);
        return CMD_WARNING;
    }
    if (ifp_name)
    {
        free(ifp_name);
        ifp_name = NULL;
    }
    return CMD_SUCCESS;
}

