void config_write_access_cisco(struct vty *vty, struct filter *mfilter)
{
    struct filter_cisco *filter;

    filter = &mfilter->u.cfilter;

    vty_out(vty, " %s", filter->protocol);
    if (filter->addr_mask.s_addr == 0xffffffff)
        vty_out(vty, " any");
    else if (filter->addr_mask.s_addr == 0)
        vty_out(vty, " host %s", inet_ntoa(filter->addr));
    else
    {
        vty_out(vty, " %s", inet_ntoa(filter->addr));
        vty_out(vty, " %s", inet_ntoa(filter->addr_mask));
    }

    if (strcmp(filter->protocol, "tcp") == 0)
        if (strlen(filter->tcp_udp_port.sport_bak))
            vty_out(vty, " %s ", filter->tcp_udp_port.sport_bak);

    if (strcmp(filter->protocol, "udp") == 0)
        if (strlen(filter->tcp_udp_port.sport_bak))
            vty_out(vty, " %s ", filter->tcp_udp_port.sport_bak);

    if (filter->mask_mask.s_addr == 0xffffffff)
        vty_out(vty, " any");
    else if (filter->mask_mask.s_addr == 0)
        vty_out(vty, " host %s", inet_ntoa(filter->mask));
    else
    {
        vty_out(vty, " %s", inet_ntoa(filter->mask));
        vty_out(vty, " %s", inet_ntoa(filter->mask_mask));
    }
    if (strcmp(filter->protocol, "icmp") == 0)
    {
        if (strlen(filter->icmp_port.dport) == 0)
        {
            if (strcmp(filter->icmp_port.sport, "8") == 0)
                vty_out(vty, " echo");
            else if (strcmp(filter->icmp_port.sport, "0") == 0)
                vty_out(vty, " echo-reply");
            else if (strcmp(filter->icmp_port.sport, "3") == 0)
                vty_out(vty, " host-unreachable");
        }
        else
        {
            vty_out(vty, " %s", filter->icmp_port.sport);
            vty_out(vty, " %s", filter->icmp_port.dport);
        }
    }
    if (strcmp(filter->protocol, "tcp") == 0)
        if (strlen(filter->tcp_udp_port.dport_bak))
            vty_out(vty, " %s", filter->tcp_udp_port.dport_bak);

    if (strcmp(filter->protocol, "udp") == 0)
        if (strlen(filter->tcp_udp_port.dport_bak))
            vty_out(vty, " %s", filter->tcp_udp_port.dport_bak);
    vty_out(vty, "%s", VTY_NEWLINE);

}

void config_write_access_zebra(struct vty *vty, struct filter *mfilter)
{
    struct filter_zebra *filter;

    struct prefix *src_p;

    struct prefix *dst_p;

    char src_buf[BUFSIZ];

    char dst_buf[BUFSIZ];

    filter = &mfilter->u.zfilter;
    src_p = &filter->src_prefix;
    dst_p = &filter->dst_prefix;
    vty_out(vty, " %s", filter->protocol);

    if (src_p->prefixlen == 0 && !filter->exact)
        vty_out(vty, " any");
    else if (src_p->prefixlen == 128)
    {
        vty_out(vty, " host %s",
                inet_ntop(src_p->family, &src_p->u.prefix, src_buf, BUFSIZ));
    }
    else
        vty_out(vty, " %s/%d",
                inet_ntop(src_p->family, &src_p->u.prefix, src_buf, BUFSIZ),
                src_p->prefixlen);
///////////////////////////////////////////////////////
    if (strcmp(filter->protocol, "tcp") == 0)
        if (strlen(filter->tcp_udp_port.sport_bak))
            vty_out(vty, " %s ", filter->tcp_udp_port.sport_bak);

    if (strcmp(filter->protocol, "udp") == 0)
        if (strlen(filter->tcp_udp_port.sport_bak))
            vty_out(vty, " %s ", filter->tcp_udp_port.sport_bak);

/////////////////////////////////////////////////

    if (dst_p->prefixlen == 0 && !filter->exact)
        vty_out(vty, " any");
    else if (dst_p->prefixlen == 128)
    {
        vty_out(vty, " host %s",
                inet_ntop(dst_p->family, &dst_p->u.prefix, dst_buf, BUFSIZ));
    }
    else
        vty_out(vty, " %s/%d",
                inet_ntop(dst_p->family, &dst_p->u.prefix, dst_buf, BUFSIZ),
                dst_p->prefixlen);

    if (strcmp(filter->protocol, "icmp") == 0)
    {
        if (strlen(filter->icmp_port.dport) == 0)
        {
            if (strcmp(filter->icmp_port.sport, "echo-request") == 0)
                vty_out(vty, " echo");
            else if (strcmp(filter->icmp_port.sport, "echo-reply") == 0)
                vty_out(vty, " echo-reply");
            else if (strcmp(filter->icmp_port.sport, "destination-unreachable")
                     == 0)
                vty_out(vty, " host-unreachable");
        }
        else
        {
            vty_out(vty, " %s", filter->icmp_port.sport);
            vty_out(vty, " %s", filter->icmp_port.dport);
        }
    }

    if (strcmp(filter->protocol, "tcp") == 0)
        if (strlen(filter->tcp_udp_port.dport_bak))
            vty_out(vty, " %s", filter->tcp_udp_port.dport_bak);

    if (strcmp(filter->protocol, "udp") == 0)
        if (strlen(filter->tcp_udp_port.dport_bak))
            vty_out(vty, " %s", filter->tcp_udp_port.dport_bak);

    vty_out(vty, "%s", VTY_NEWLINE);
}

int config_write_access(struct vty *vty, afi_t afi)
{
    struct access_list *access;

    struct access_master *master;

    struct filter *mfilter;

    int write = 0;

    master = access_master_get(afi);
    if (master == NULL)
        return 0;

    for (access = master->num.head; access; access = access->next)
    {
        vty_out(vty, "%s access-list %s",
                afi == AFI_IP ? "ip" : "ipv6", access->name);
        vty_out(vty, "%s", VTY_NEWLINE);
        if (access->remark)
            vty_out(vty, " remark %s%s", access->remark, VTY_NEWLINE);

        for (mfilter = access->head; mfilter; mfilter = mfilter->next)
        {

            vty_out(vty, " %s", filter_type_str(mfilter));
            if (mfilter->cisco)
                config_write_access_cisco(vty, mfilter);
            else
                config_write_access_zebra(vty, mfilter);

            write++;
        }
    }

    for (access = master->str.head; access; access = access->next)
    {
        vty_out(vty, "%s access-list %s",
                afi == AFI_IP ? "ip" : "ipv6", access->name);
        vty_out(vty, "%s", VTY_NEWLINE);

        if (access->remark)
            vty_out(vty, " remark %s%s", access->remark, VTY_NEWLINE);

        for (mfilter = access->head; mfilter; mfilter = mfilter->next)
        {
            vty_out(vty, " %s", filter_type_str(mfilter));
            if (mfilter->cisco)
                config_write_access_cisco(vty, mfilter);
            else
                config_write_access_zebra(vty, mfilter);

            write++;
        }
    }
    return write;
}

